/**
 * Find all links and frames on this page.
 * @return {Array<string>} List of all urls.
 */
function get_urls() {
    var urls = [];
    // Copy the link nodelist into an array.
    var a = document.getElementsByTagName('A');
    for (var idx = 0; idx < a.length; ++idx) {
        urls.push(a[idx].href);
    }
    // Finding frame URLs using window.frames doesn't work since
    // the framed windows haven't been loaded yet.
    if (window.frames.length) {
        var frames = document.getElementsByTagName('FRAME');
        for (var frame, x = 0; frame = frames[x]; x++) {
            urls.push(frame.src);
        }
        var iframes = document.getElementsByTagName('IFRAME');
        for (var frame, x = 0; frame = iframes[x]; x++) {
            urls.push(frame.src);
        }
    }
    return urls;
}

function get_inline() {
    var urls = [];
    // CSS and favicons.
    var links = document.getElementsByTagName('LINK');
    for (var link, x = 0; link = links[x]; x++) {
        if (link.href) {
            urls.push(link.href);
        }
    }
    // Images
    var imgs = document.getElementsByTagName('IMG');
    for (var img, x = 0; img = imgs[x]; x++) {
        if (img.src) {
            urls.push(img.src);
        }
    }
    return urls;
}
function get_scripts() {
    var urls = [];
    // Scripts
    var scripts = document.getElementsByTagName('SCRIPT');
    for (var script, x = 0; script = scripts[x]; x++) {
        if (script.src) {
            urls.push(script.src);
        }
    }
    // Embed
    var embeds = document.getElementsByTagName('EMBED');
    for (var embed, x = 0; embed = embeds[x]; x++) {
        if (embed.src) {
            urls.push(embed.src);
        }
    }
    return urls;
}

function get_painting() {

    var $info = $('#theActualImage').find(".zoomTool").find(".info");
 
    if ($info.length) {
        return {
            title: $info.find(".title h1").text(),
            date: $info.find(".title h2").text(),
            artist: $info.find(".title a").text(),
            artistPage: $info.find(".title a").attr("href"),
            img: $('#theActualImage').find(".zoomTool .main .tiles img.tile").attr("src")



        }
    }
    else {
        return null;

    }



}



window.attemptedLoads = 0;

function finish() {
    if ((!document || document.readyState != 'complete') && window.attemptedLoads < 6) {
        window.clearTimeout(window.pageLoaderPid);
        window.pageLoaderPid = window.setTimeout(finish, 200);
        window.attemptedLoads++;
        return;
    }
    chrome.runtime.sendMessage({
        links: get_urls(),
        inline: get_inline(),
        scripts: get_scripts(),
        painting: get_painting(),
        url: document.location.href
    });
}

window.pageLoaderPid = window.setTimeout(finish, 200);
controllers.controller('tateController', ['$scope', '$window', '$document','$compile', 'Neo', 'Utils',function ($scope, $window, $document, $compile,neo,utils) {

      


         var $nodeLookup = $compile("<div style='width:450px'><typeahead choice='nodeLookup' class='nodeSearch' text='nodeLookupText' placeholder='Node Lookup...' style='left:300px'></typeahead><button type='button' class='btn' style='float:right;' id='captureAll'>Capture All</button></div>")($scope);
         $nodeLookup.insertAfter('.aa-header');

         $("#captureAll").on("click",function () {

             $(".grid-item-inner").each(function (i, e) {

                 capture($(e));

                

             })

         }).insertAfter($nodeLookup);


         var capture = function (el) {

             var linkprefix = "http://www.tate.org.uk";

             var img = el.find(".grid-item-image a img");

             if (img.length) {

                 var thumbsrc = linkprefix + decodeURIComponent(img.attr("src"));
                 var imgsrc = thumbsrc.replace("_8.jpg", "_10.jpg");

                 var metadiv = el.find(".grid-item-text");
                 var newNode = {
                     id: -1,
                     labels: ["Tate", "Picture", "UnCached", $scope.nodeLookup.Lookup],
                     Type: "Picture",
                     ImageWidth: img.attr("width"),//nb these are the thumb sizes ! should be sufficient to deduce proportions
                     ImageHeight: img.attr("height"),
                     //ImageSize: data.meta.os,
                     ImageUrl: imgsrc,
                     ImageRef: linkprefix + decodeURIComponent(el.find(".grid-item-image a").attr("href")),
                     ImageSite: "tate.org.uk",
                     ImageThumb: thumbsrc,
                     Title: metadiv.find(".title").text(),
                     Description: img.attr("alt"),
                     Date: metadiv.find(".dates").text(),
                     TateID: metadiv.find(".acno").text(),
                     Status: 9,
                     temp: {
                         relProps: {
                             "by": {
                                 predicate: new utils.Predicate("BY", "out")
                                     ,
                                 items: [{
                                     id: $scope.nodeLookup.id
                                 }]
                             }
                         }
                     }
                 }

                 console.log(newNode);

                 var user = { Lookup: 'Julian' }

                 neo.saveNode(newNode, user);

             }


         }

         function addCaptureButton() {


             $("<button  type='button'  class='btn captureButton' style='position:absolute;left:2px;top:2px'>Capture</button>")
                 .insertAfter(".art-results .grid-item-image:not(.capture) a")
                 .on("click", function () {

                     capture($(this).closest(".grid-item-inner"));
               

                 })


             $(".art-results .grid-item-image").addClass("capture");

         }

     
         addCaptureButton();
      


      
     }]);


